@ANI मैं सहमत हूं कि @narendramodi जी ने बहुतों को बेरोजगार कर दिया,

लेकिन कोई यह भी बताओ कि 85 पैसे पाने वाले 14 से पहले कौन सा काम किया करते थे जिन्हें मोदी जी नें बंद करवा दिया ?

जिसे ₹15 की बिसलरी के कारण देश में गरीबी दिखाई नहीं दी आज वहीं चिदंबरम महंगाई पर काॅलम लिख रहा है ? https://t.co/IsyvOsa11F
